        `},{id:"8",title:"Manuel mi Otomatik mi? Hangi Ehliyet Snf Size Uygun?",description:"B Manuel mi yoksa B Otomatik mi almalsnz? htiyalarnza, btenize ve sr hedeflerinize gre doru tercihi yapn.",image:"https://images.unsplash.com/photo-1449965408869-eaa3f722e40d?ixlib=rb-4.0.3&auto=format&fit=crop&w=1470&q=80",category:"Rehber",categoryColorClass:"bg-purple-600",date:"Ehliyet Seimi",slug:"manuel-mi-otomatik-mi",author:"Eitim Danman",tags:["ehliyet snf","otomatik vites","manuel vites"],content:`
